import axios from "axios";
import React, { useState } from "react";
import styled from "styled-components";

// import google from "./continue_google_light.png";
import google from "./continue_google_neutral.png";
// import google from "./continue_google_black.png";


import logo from "../../components/Nav/images/rock_w_logo.svg";


// Logins-로그인
function Logins() {
    const navigate = useNavigate();

    useEffect(() => {
        const form = document.getElementById('login-form');

        const handleSubmit = async (e) => {
            e.preventDefault();

            const username = document.getElementById('username').value;
            const password = document.getElementById('password').value;

            const response = await fetch('/auth/login', {
                method: 'POST',
                headers: {
                    'Content-Type': 'application/json'
                },
                body: JSON.stringify({
                    memId: username,
                    memPassword: password
                })
            });

            if (response.ok) {
                const data = await response.json();
                localStorage.setItem('accessToken', data.accessToken);
                localStorage.setItem('loginMethod', 'custom');
                navigate('/')
            } else {
                alert('로그인 실패');
            }
        };

        form.addEventListener('submit', handleSubmit);

        return () => {
            form.removeEventListener('submit', handleSubmit);
        };
    }, []);

    const handleGoogleLogin = () => {
        window.location.href = 'http://localhost:8080/oauth2/authorization/google';
    };

    // const [email, setEmail] = useState("");
    // const [password, setPassword] = useState("");
    //
    // let body = {
    //     username: email,
    //     password: password,
    // };
    //
    // const onSubmit = async () => {
    //     try {
    //         const response = await axios.post(
    //             "https://backend.alittlevanilla.kro.kr/member/authenticate",
    //             body,
    //             {
    //                 headers: { "Content-Type": "application/json" },
    //             }
    //         );
    //
    //         console.log(response.data.token);
    //
    //         if (response.data.token !== null) {
    //             localStorage.clear();
    //             localStorage.setItem("token", response.data.token);
    //             console.log("response.data.token:  " + response.data.token);
    //
    //             window.location.replace("/");
    //         } else {
    //             setEmail("");
    //             setPassword("");
    //             localStorage.clear();
    //         }
    //     } catch (e) {
    //         alert(
    //             "회원 정보가 일치 하지 않습니다. 아이디와 비민번호를 다시 확인해 주세요!"
    //         );
    //         console.log(e);
    //     }
    // };
//html
    return (
        <>
            <LoginWrap>
                <LoginContainer>
                    <LoginSigninContent>
                        <BorderAndText>
                            <LoginHeadText>로그인<br/>
                                <span>Rock 계정으로 로그인</span>
                            </LoginHeadText>
                        </BorderAndText>

                        <EmailLoginContainer>
                            <div>
                                <EmailLoginInput
                                    id="email"
                                    type="email"
                                    value={email}
                                    placeholder="아이디"
                                    required
                                    onChange={(e) => {
                                        setEmail(e.target.value);
                                    }}
                                />
                                <EmailLoginInput
                                    id="password"
                                    // type="password"
                                    value={password}
                                    placeholder="비밀번호"
                                    required
                                    onChange={(e) => {
                                        setPassword(e.target.value);
                                    }}
                                />
                            </div>
                            <EmailLoginOption>
                                <div>
                                    <InputCheckbox>
                                        <Bp type="checkbox"></Bp>
                                    </InputCheckbox>
                                    <label for="id-save">아이디 저장</label>
                                </div>
                                <a href="/FindIdPassword">아이디 찾기&nbsp;&nbsp;|&nbsp;&nbsp;비밀번호 찾기</a>
                            </EmailLoginOption>


                            {/*로그인 버튼*/}
                            <CommonButton
                                type="button"
                                onClick={({handleGoogleLogin}) => {
                                    onSubmit();
                                    console.log("body: " + email + ", " + password);
                                }}
                            >
                                <a>로그인</a>
                            </CommonButton>


                            {/*회원가입 버튼*/}
                            <SignupButton
                                type="button"
                                onClick={() => {
                                    onSubmit();
                                    console.log("body: " + email + ", " + password);
                                }}
                            >
